/// contains a `OOA` and returns it.
/// Note that verification is still experimental and may not
/// catch every error, or be maximally performant. For the
/// previous, unchecked, behavior use
/// `root_as_OOA_unchecked`.
pub fn root_as_OOA_with_opts<'b, 'o>(
  opts: &'o flatbuffers::VerifierOptions,
  buf: &'b [u8],
) -> Result<OOA<'b>, flatbuffers::InvalidFlatbuffer> {
  flatbuffers::root_with_opts::<OOA<'b>>(opts, buf)
}
#[inline]
/// Verifies, with the given verifier options, that a buffer of
/// bytes contains a size prefixed `OOA` and returns
/// it. Note that verification is still experimental and may not
/// catch every error, or be maximally performant. For the
/// previous, unchecked, behavior use
/// `root_as_OOA_unchecked`.
pub fn size_prefixed_root_as_OOA_with_opts<'b, 'o>(
  opts: &'o flatbuffers::VerifierOptions,
  buf: &'b [u8],
) -> Result<OOA<'b>, flatbuffers::InvalidFlatbuffer> {
  flatbuffers::size_prefixed_root_with_opts::<OOA<'b>>(opts, buf)
}
#[inline]
/// Assumes, without verification, that a buffer of bytes contains a OOA and returns it.
/// # Safety
/// Callers must trust the given bytes do indeed contain a valid `OOA`.
pub unsafe fn root_as_OOA_unchecked(buf: &[u8]) -> OOA {
  flatbuffers::root_unchecked::<OOA>(buf)
}
#[inline]
/// Assumes, without verification, that a buffer of bytes contains a size prefixed OOA and returns it.
/// # Safety
/// Callers must trust the given bytes do indeed contain a valid size prefixed `OOA`.
pub unsafe fn size_prefixed_root_as_OOA_unchecked(buf: &[u8]) -> OOA {
  flatbuffers::size_prefixed_root_unchecked::<OOA>(buf)
}
pub const OOA_IDENTIFIER: &str = "$OOA";

#[inline]
pub fn OOA_buffer_has_identifier(buf: &[u8]) -> bool {
  flatbuffers::buffer_has_identifier(buf, OOA_IDENTIFIER, false)
}

#[inline]
pub fn OOA_size_prefixed_buffer_has_identifier(buf: &[u8]) -> bool {
  flatbuffers::buffer_has_identifier(buf, OOA_IDENTIFIER, true)
}

#[inline]
pub fn finish_OOA_buffer<'a, 'b, A: flatbuffers::Allocator + 'a>(
    fbb: &'b mut flatbuffers::FlatBufferBuilder<'a, A>,
    root: flatbuffers::WIPOffset<OOA<'a>>) {
  fbb.finish(root, Some(OOA_IDENTIFIER));
}

#[inline]
pub fn finish_size_prefixed_OOA_buffer<'a, 'b, A: flatbuffers::Allocator + 'a>(fbb: &'b mut flatbuffers::FlatBufferBuilder<'a, A>, root: flatbuffers::WIPOffset<OOA<'a>>) {
  fbb.finish_size_prefixed(root, Some(OOA_IDENTIFIER));
}
